    </ul>
    <h2 {...{
      "id": "示例"
    }}>{`示例`}</h2>
    <h3 {...{
      "id": "默认"
    }}>{`默认`}</h3>
    <p>{`表单的详细使用方法请参考`}<inlineCode parentName="p">{`EditForm`}</inlineCode></p>
