ame: \'age\',\n                  label: \'年龄\',\n                  content: <InputNumber />,\n                },\n              ],\n              onCancel: () => {\n                message.info(\'取消\')\n              },\n              onError: () => {\n                message.error(\'保存出错\')\n              },\n              onOk: () => {\n                message.success(\'保存成功\')\n              },\n            }}\n            visible={visible}\n            close={() => this.setState({ visible: false })}\n          />\n        </div>\n      )\n    }\n  }'} __scope={{
